// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "@openzeppelin/contracts/proxy/Clones.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./Patient.sol";
import "./Helper.sol";

contract PatientFactory is Ownable {
    address immutable patientImplementation;

    constructor() {
        patientImplementation = address(new Patient());
    }

    function createPatient(
        address owner_,
        Bytes32Pair memory nameGender_,
        uint256 dob_,
        uint16 height_,
        uint16 weight_,
        string[] memory allergy_,
        BoolTriple memory alcoholSmokeCannabis_,
        FromAppOption memory option_
    ) external onlyOwner returns (address clone) {
        clone = Clones.clone(patientImplementation);
        if (option_.fromApp) {
            Patient(clone).initializeWithApp(
                msg.sender,
                owner_,
                option_.addr,
                Bytes32Pair(nameGender_.value1, nameGender_.value2),
                dob_,
                height_,
                weight_,
                allergy_,
                BoolTriple(
                    alcoholSmokeCannabis_.value1,
                    alcoholSmokeCannabis_.value2,
                    alcoholSmokeCannabis_.value3
                )
            );
        } else {
            Patient(clone).initialize(
                msg.sender,
                owner_,
                Bytes32Pair(nameGender_.value1, nameGender_.value2),
                dob_,
                height_,
                weight_,
                allergy_,
                BoolTriple(
                    alcoholSmokeCannabis_.value1,
                    alcoholSmokeCannabis_.value2,
                    alcoholSmokeCannabis_.value3
                )
            );
        }
    }
}
